import HomePage from "./page/HomePage";
import LoginPage from './page/Create-Login/LoginPage'
import CreateAccountPage from './page/Create-Login/CreateAccountPage'
import Menu from "./components/Menu/Menu";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import CommentView from "./components/CommentsView/CommentView";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/create-account" element={<CreateAccountPage />} />
        <Route path="/testing" element={<CommentView />} />
      </Routes>
    </BrowserRouter>

  );
}

export default App;
